import React from 'react'
import styled from 'styled-components'

const Main_wrapper = styled.div`
    display: grid;
    width: 99em;
    grid-template-columns: 8em 1fr;
    grid-template-rows: 55px 1fr;
    grid-gap: 1em;
    height: 45em;
    padding: 0.3em;
    margin: 0 auto;
`

export default Main_wrapper
